[{'rating': 5, 'description': 'We were at Tandoor recently after their revamp and had a wonderful lunch experience. The food was priced reasonably, and the half portions were more than generous for 2 of us. One suggestion would be to char the tandoori prawns slightly more as we felt that could have been improved. Loved the mushroom peas masala! However, to give credit where it is due, the manager on duty did come around to check on the food and ask if anything could be improved while we were there. The service was friendly, and polite without being too intrusive. It was a quiet lunch time with around 4 to 5 tables filled and the 2 staff on duty were attentive. We appreciated the complimentary dessert platter which was offered when we placed our dessert orders - a nice touch to end the meal.

One AFI would be the choice of music which would be appropriate and enhance the ambience as well. Perhaps pop music may not be the right choice but instrumental Indian music might have been better.

We had a great lunch and will be back. Thank you!', 'date': 'a month ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 1, 'description': 'We went for vegetarian options. Food was below average. Service was ok. Ambiance was ok.', 'date': 'a month ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 3, 'description': 'Good food. Expensive for the experience.

Food was good though not outstanding. Price is way steep. I confess that it left a bad taste in the mouth to pay $12 for a bowl of plain rice or $8 for a Naan.

We ordered the crab curry which was the highlight of the meal. Also ordered the Butter Chicken which was average.

Service was also average. Poor if you consider that they want to be positioned as Indian Fine Dining.

In sum, food was good but terrible value for money considering the price and overall experience.', 'date': '2 years ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 4, 'description': 'Very nice food anf cozy ambience. Loved it.. We went for our marriage anniversary celebration. The starters are really yummy. especially the lamp chopsüòÉüòÉüòÉüòçüòçüòç. Tender and juicy üòãüòãüòã', 'date': '4 years ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 5, 'description': 'Not too crowded. Good place to have conversation over dinner. Dishes are fantastic especially the curry and naan. The flavours in the spices are so complex. Grateful for the professionalism in service staff who is able to provide sound advice. Will be back to try other dishes.', 'date': '3 years ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 4, 'description': 'The Damage (no drinks): S$90-120 for two

Upscale Indian food restaurant that features solid classic Indian dishes and new age fusion flavors. Service is professional. Hits include their Lahsooni Palak and Crab Masala

