Follow us at IG: eatsmorefun', 'date': '5 years ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 5, 'description': 'Fine Indian style dining, friendly service. Perfect tasting of the curry and bread. Most of the dishes have mixed with the chill powder, so more spicy taste.', 'date': '3 years ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}, {'rating': 5, 'description': 'Best Indian Restaurant at Orchard Singapore

Since 1985 Tandoor an award-winning Indian restaurant in Singapore has offered a carefully handcrafted dish using classic recipes and time-honoured methods which date back in time across India‚Äôs rich history. The beautiful interior design has a story behind it, Full-length windows give diners an intimate view of the kitchen where two custom-made copper tandoors (or clay ovens) stand. From the dining hall, you will be able to see our chefs at work, from making Indian breads to preparing kebabs of tandoori meats and vegetables that are served fresh to your table, presents an inviting atmosphere where you can enjoy good food and great conversations with family, friends and clients alike.', 'date': '4 years ago', 'images': ['https://storage.googleapis.com/synthesis_geos_public/thumbnails/thumb_unavail.jpg']}]
